-- (2,'Washington Square Park','Washington Square Park is another one of my favorite places to hang in the city, especially on a Spring or Summer day.Head here to hang around the fountain, people watch, eat a snack, and view the Washington Square Arch. During the Summer, they also hold different free activities you can check for!','Washington Square N', 'New York', 'NY', 10012,1,1),
-- (2,'Flushing Meadows Corona Park','Another excellent and free park to visit in NYC is the Flushing Medows Park! You might remember this park from the Movie Men and Black with the two observation towers! Located in Flushing, Queens, it is also the 4th largest park in NYC! The park is also widely known as the home of the 1939 and 1964 Wold Fair! Additionally, if you visit during the spring, you will have the opportunity to see some really beautiful cherry blossoms!','Between Grand Central Pkwy and Van Wyck Expy','Queens','NY', 11354,1,3),
-- (2,'Spirit Of The City Instalition','Created by MINI and the London-based practice United Visual Artists, "Spirit Of The City" is an installation in the Greenpoint creative space A/D/O. Probing the physical and emotional response individuals experience when navigating urban environments, the installation is a sequence of mirrors that not only reflects the people around it but also changes according to the lighting and shadows of the day. On view until September 2nd.','29 Norman Ave', 'Brooklyn', 'NY', 11222,4,2),
-- (2,'Rockefeller Center','Rockefeller Center is one of my all-time favorite places to visit in NYC during the holidays, but it’s still great all season long. Around the area are tons of food spots, Radio City Music Hall, Saint Patricks Cathedral, and a stroll down 5th Ave to all the high-end designer stores.If your budget does allow it, I would recommend getting tickets for visiting the Top of the Rock. This is easily one of the best observation decks in NYC and is located at Rockefeller Plaza. If you do plan on doing a lot of paid attractions, your best bet will probably be an NYC Sightseeing Pass – will cover below!','45 Rockefeller Plaza', 'New York', 'NY', 10111,2,1),
-- (2,'The Oculus','The Oculus is a part of the new World Trade Center Transportation hub that acts as both a mall and subway station. This architectural gem was designed by Santiago Calatrava.Make sure to check out the Oculus from both the inside and outside since both are very picturesque! They often have a farmers market inside the Oculus along with a Christmas Market during the holidays. It is also a part of a larger shopping hub with tons of stores.','Church St', 'New York', 'NY', 10006,3,1),
-- (2,'The Brooklyn Bridge','Make your way to the famous Brooklyn Bridge and cross over to DUMBO Down Under Manhattan Bridge Overpass, Brooklyn. The bridge spans 1.1 miles and was once the largest suspension bridge.When the bridge originally opened, it actually wasn’t a free NYC activity to do. It cost a penny to cross by foot, and 5 cents by horse and carriage.Thankfully, we can add crossing the Brooklyn Bridge to one of the many awesome free things to do in NYC now! When crossing the Bridge, you will also be treated to fantastic views of Manhattan!','Brooklyn Bridge','New York','NY',10038,2,1),
-- (2,'Brooklyn Bridge Park','After crossing the bridge, hang out in Dumbo around Brooklyn Bridge Park. The park/pier is especially nice during the Spring/ Summer where you will find people out picnicking on the lawns, and further down roller skating, enjoying Jane’s Carousel, playing basketball, and more.From the walkway, you can even see the Statue of Liberty from a “very” far.','334 Furman St', 'Brooklyn', 'NY', 11201,1,2),
-- (2,'Coney Island Boardwalk','This can’t be a full list of free things to do in NYC without adding the famed Coney Island Boardwalk. It is especially nice to visit during the spring/summer when the weather is nice. You can enjoy getting some sun at the beach and people watch some really interesting characters! If this is your first time in New York and you are pressed for time, I would leave this one out, however.','1000 Surf Ave', 'Brooklyn', 'NY', 11224,1,2);








