INSERT INTO activity (user_id,name,description,street_address,city,state,zip_code,category_id,city_id) VALUES
(1,'XO World Project Sculpture','Consider checking out the XO World Project Sculpture located at the World Trade Center Campus. Designed by Daniel Anderson, the sculpture is a part of the “Share Love” movement to activate positivity, hope, and inclusiveness among people. The sculpture is made from 20,000 lbs of stainless steel and stands 12 ft. high by 24 ft. wide! It will be here for 2 years, so enjoy it while you can.','117 West St','New York', 'NY', 10007,4,1),
(1,'Staten Island Ferry','Did you say free transportation in NYC?! I know, shocking right! I guess they had to make it up somewhere for charging us locals over $15 USD to cross into Staten Island over the Verrazano Bridge.Anyways, so why would you even want to take a ride on this ferry you ask? Well because it’s the closest you will get to the Statue of Liberty for free!While on the ferry, you can stand in the front and back of the boat while in motion to get a really nice view of the Statue of Liberty and that stunning NYC Skyline.','79 N 11th St', 'Brooklyn', 'NY',11249,2,2),
(1,'Little Island NYC','All the hype has been around the new New York City Public Park, Little Island! This is a really unique and free public park because it is actually built on 132 pillars, making it an artificial island. The park is 2.4 acres and is located at Pier 55 on the Hudson.','Pier 55 at Hudson River Park Hudson River Greenway','New York', 'NY', 10014,1,1),
(1,'The Flatiron Building','If architecture fascinates you, pay a visit to one of NYC’s most photographed buildings for its unique triangular shape splitting the streets. This 22 story building originally known as the Fuller Building opened in 1902.If architecture fascinates you, pay a visit to one of NYC’s most photographed buildings for its unique triangular shape splitting the streets. This 22 story building originally known as the Fuller Building opened in 1902.While you can’t officially go inside, you can snap a couple of photos, hang out in Madison Square Park, or even hit up Eataly for food heaven!','175 5th Ave', 'New York', 'NY', 10010,3,1),
(1,'Soho NYC Murals','Soho happens to be one of my top 3 favorite neighborhoods in all of New York City! I worked in Soho for 2 years and the cute cobblestone streets, art, and shopping make it the perfect place to explore.If you are a Nespresso lover like me, they have a flagship store on Spring and Prince street, which is where I worked during my college days.','250 Mulberry St', 'New York', 'NY', 10012,4,1),
(1,'Bryant Park','If you love parks in urban spaces, make sure to add Bryant Park to your list! This green square is 9.6 acres and regularly holds free events during the Summer including movie screenings, exercise classes, and more!Oh, and during the holidays Bryant Park hosts the Bank of America Winter Village! This Winter Village offers free Ice skating in NYC (bring your own skates), a pop-up Christmas Market, tons of food vendors, and even Cozy Winter Igloos!','25 W 40th St','New York', 'NY', 10018,1,1),
(1,'The Polonsky Exhibition','Hundreds of items have been pulled from the New York Public Library expansive and centuries-spanning archive to be put on display—many of them for the first time—in a permanent exhibition called The Polonsky Exhibition of The New York Public Library’s Treasures.Inside the NYPL Stephen A. Schwarzman Building and its beautiful Gottesman Hall, are more than 250 unique and rare items culled from its research centers: the Stephen A. Schwarzman Building, the Library for the Performing Arts and the Schomburg Center for Research in Black Culture.The exhibit, which opens to the public on Friday, September 24, spans 4,000 years of history and includes a wide range of history-making pieces, including the only surviving letter from Christoper Columbus announcing his discovery" of the Americas to King Ferdinand’s court and the first Gutenberg Bible brought over to the Americas.','476 5th Ave', 'New York', 'NY', 10018,4,1),
(1,'Gantry Plaza State Park','Not to be mistaken for Long Island, NY, I feel like Long Island City which is in Queens is often forgotten. Quite frankly, it is a shame because Long Island City (LIC) offers great restaurants, museums,  and one of my favorite parks, The Gantry Plaza State Park.This epic and free NYC park offers 12 acres of riverside views, green spaces, recreational spaces, and an incredible backdrop of Midtown Manhattan!  Make sure to see the giant Long Island sign and the Pepsi Cola sign while you are there!','4-09 47th Rd', 'Queens', 'NY', 10007,1,3),
(1,'NYC Public Library','I’ve never been inside the NYC Public Library, but as a kid, I did once sit on the lion statues outside….. and then prompted to get down immediately! I do have a library card though!But if you love books and awesome architecture, the NYC Public Library should definitely be on your list of free things to do in NYC! It is still on my bucket list to visit inside.','135 E 46th St', 'New York', 'NY', 10017,2,1),
(1,'The Vessel','Starting with NYC’s newest attraction, The Vessel! Located in the Hudson Yards, the Vessel is easily one of the best free things to do during your visit to NYC.','20 Hudson Yards','New York','NY',10001,3,1),
(1,'The Highline','Make your way to the Chelsea Highline. This iconic railway turned greenway is one of my all-time favorite places to visit, especially on a nice sunny day!','-','New York','NY',10011,2,1),
(1,'Central Park','Central Park is a staple for NYC and luckily for all of us, it’s among one of the many free things to do!','3234 5th Ave','New York','NY',10075,1,1),
(2,'Chrysler Building','One of the coolest Sky Scrappers IMO goes to the Chrysler Building. This gem of a building stands at 1,046 ft high from the antenna spire and is the world’s tallest brick building with steelwork! The building was completed in a little less than 2 years opening up in 1930.The Chrysler Buiding is the 11th tallest skyscraper in NYC and it can be found on lists of favorite architecture due to its unique art deco style. So why should you care? Because besides seeing it in the famous NYC skyline, you can also visit the lobby for free.','405 Lexington Ave', 'New York', 'NY', 10174,3,1),
(2,'Grand Central Station','Grand Central Station is probably one of the prettiest subway stations in NYC. Who knew a train station could be NYC must-do on your itinerary?!Besides being the backdrop of more movies than I can count, the ceiling art is stunning, and it’s a great place to people watch. While inside, you will find restaurants, a farmers market, the whispering walls, and shopping.  After hanging out at Grand Central, you can take the S line right into Times Square, win, win!','89 E 42nd St','New York', 'NY', 10017,3,1),
(2,'Times Square','Did you even visit NYC without walking through Times Square? This is easily one of the top things to do in NYC especially for first-timers that of course, is also free.With huge billboards, the M&M store (yum), the naked cowboy, people doing street performances, it’s definitely an interesting place to experience, to say the least!','-','New York','NY', 10036,2,1);
